var docData = {"document":{"title":"DAdmin - Responsive Bootstrap HTML Admin Dashboard"},"contents":[{"title":"Getting Started","contents":[{"title":"Introduction","content":"<p>Thank you for purchasing <b>DAdmin</b> admin theme. If you have any questions that are beyond the scope of this help file or premium installation and customization request, please feel free to contact us via our <a href=\"https://themeforest.net/user/themelooks#contact\" target=\"_blank\">profile contact form</a>. Thank you so much!</p><p><b>DAdmin</b>&nbsp;is a <b>Responsive Bootstrap HTML Admin Dashboard</b> designed to build any kinds of <b>Admin Dashboard Panel</b>. It's an HTML5 template based on latest stable Bootstrap 4.1.1. Anyone can easily update/edit this template to follow our <b>Well Sorted Documentation</b>.</p><h4><b>Main Features:</b></h4><ul><li><b>Bootstrap 4</b> Framework</li><li>Fully <b>Responsive</b> Pages</li><li>Clean Design</li><li><b>Vector Maps</b>&nbsp;Included</li><li><b>Retina Ready</b></li><li>800+ <b>Google Fonts</b></li><li><b>Font Awesome</b> Icons</li><li><b>W3C Validated Code</b></li><li>Modern <b>Cross Browser Supported</b></li><li>In-depth <b>Documentation</b></li><li><b>Apps:</b></li><ul><li><b>Mailbox</b> App</li><li><b>Calendar</b> App</li><li><b>Contacts</b> App</li><li><b>Note</b> App</li><li><b>Todo List</b> App</li></ul><li><b>Extra Pages:</b></li><ul><li><b>Pricing Table, Profile, Invoice</b> Page</li><li><b>Login, Register, Forgot Password, Lock Screen</b> Page</li><li><b>404 Error, 500 Error</b> Page</li><li><b>Maintance, Coming Soon</b> Page</li></ul></ul><h4><b>How to get help:</b></h4><p>We run support 24/7. You can expect a response within 24 hours.</p><p><b style=\"color: rgb(57, 123, 33);\">Support Requests Are For:</b></p><ul><li>Help Using Templates</li><li>Instructions Setting Up Templates</li><li>Bug Reports And Fixes</li></ul><p><span style=\"color: rgb(255, 0, 0); font-weight: bold;\">Support Requests Arenâ€™t For:</span></p><ul><li>Help With 3rd Party Plugins</li><li>Integration of 3rd Party Plugins</li><li>Free Customization Requests of Our Templates</li></ul><p>Please take a look at our <a href=\"https://www.themelooks.com/support/support-policy/\" target=\"_blank\">Support Policy</a>.</p>"},{"title":"Installation","content":"<p>This is a simple static HTML template, so no need any headech to install it.<br></p>"},{"title":"What's Included in The Package","content":"<p><b>Template Files:</b></p><ul><li>/main-files/dadmin/</li></ul><p><b>Documentation:</b></p><ul><li>/main-files/documentation/<br></li></ul>"},{"title":"Directory Structure Overview","content":"<p>/main-files/dadmin/<br></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 1200px;\"><br></p>"},{"title":"HTML Structure","content":"<p>The \"Dadmin\" template is a responsive HTML template based on Bootstrap 4.1.1. The structure based on a flexible grid that lets you change HTML pages quickly and logically with a nestable system.</p><p>If you would like to edit the layout of any elements in the whole template, you would do the following:</p><ul><li>Open any '.html' or, '.css', so that is extremely easy to change any HTML markup and CSS attributes. Simply find the related and commented heading in the HTML or, CSS file and make your magic.</li></ul><pre class=\"language-html\"><code>&lt;!DOCTYPE html&gt;\n&lt;html dir=\"ltr\" lang=\"en\" class=\"no-outlines\"&gt;\n&lt;head&gt;\n    ...\n&lt;/head&gt;\n&lt;body&gt;\n\n    &lt;!-- Wrapper Start --&gt;\n    &lt;div class=\"wrapper\"&gt;\n        &lt;!-- Navbar Start --&gt;\n        &lt;header class=\"navbar navbar-fixed\"&gt;\n            ...\n        &lt;/header&gt;\n        &lt;!-- Navbar End --&gt;\n\n        &lt;!-- Sidebar Start --&gt;\n        &lt;aside class=\"sidebar\" data-trigger=\"scrollbar\"&gt;\n            ...\n        &lt;/aside&gt;\n        &lt;!-- Sidebar End --&gt;\n\n        &lt;!-- Main Container Start --&gt;\n        &lt;main class=\"main--container\"&gt;\n            ...\n        &lt;/main&gt;\n        &lt;!-- Main Container End --&gt;\n    &lt;/div&gt;\n    &lt;!-- Wrapper End --&gt;\n\n&lt;/body&gt;\n&lt;html&gt;</code></pre>"},{"title":"CSS Structure","content":"<pre class=\"language-html\"><code>&lt;!-- Stylesheets --&gt;\n&lt;link rel=\"stylesheet\" href=\"assets/css/bootstrap.min.css\"&gt;\n&lt;link rel=\"stylesheet\" href=\"assets/css/fontawesome-all.min.css\"&gt;\n&lt;link rel=\"stylesheet\" href=\"assets/css/jquery-ui.min.css\"&gt;\n&lt;link rel=\"stylesheet\" href=\"assets/css/perfect-scrollbar.min.css\"&gt;\n&lt;link rel=\"stylesheet\" href=\"assets/css/morris.min.css\"&gt;\n&lt;link rel=\"stylesheet\" href=\"assets/css/select2.min.css\"&gt;\n&lt;link rel=\"stylesheet\" href=\"assets/css/jquery-jvectormap.min.css\"&gt;\n&lt;link rel=\"stylesheet\" href=\"assets/css/horizontal-timeline.min.css\"&gt;\n&lt;link rel=\"stylesheet\" href=\"assets/css/weather-icons.min.css\"&gt;\n&lt;link rel=\"stylesheet\" href=\"assets/css/dropzone.min.css\"&gt;\n&lt;link rel=\"stylesheet\" href=\"assets/css/ion.rangeSlider.min.css\"&gt;\n&lt;link rel=\"stylesheet\" href=\"assets/css/ion.rangeSlider.skinFlat.min.css\"&gt;\n&lt;link rel=\"stylesheet\" href=\"assets/css/datatables.min.css\"&gt;\n&lt;link rel=\"stylesheet\" href=\"assets/css/fullcalendar.min.css\"&gt;\n&lt;link rel=\"stylesheet\" href=\"assets/css/style.css\"&gt;\n\n&lt;!-- Page Level Stylesheets --&gt;\n</code></pre><p><br></p><pre class=\"language-css\"><code>/*\n\nProject     : DAdmin - Responsive Bootstrap HTML Admin Dashboard\nVersion     : 1.1\nAuthor      : ThemeLooks\nAuthor URI  : https://themeforest.net/user/themelooks\n\n\nNOTE:\n------\nPLEASE DO NOT EDIT THIS CSS, YOU MAY NEED TO USE \"style.min.css\" FILE FOR WRITING YOUR CUSTOM CSS.\nWE MAY RELEASE FUTURE UPDATES SO IT WILL OVERWRITE THIS FILE. IT'S BETTER AND SAFER TO USE \"style.min.css\".\n\n\n[TABLE OF CONTENTS]\n\n1. GENERAL STYLES\n    1.1. LINKS\n    1.2. HEADINGS\n    1.3. FORM ELEMENTS\n    1.4. ICONS\n\n2. UTILITY CLASSES\n    2.1. WIDTH\n    2.2. HEIGHT\n    2.3. BACKGROUND COLORS\n    2.4. BACKGROUND IMAGE\n    2.5. BACKGROUND OVERLAY\n    2.6. TEXT COLORS\n    2.7. BORDER COLORS\n    2.8. FONTS\n    2.9. GUTTERS\n\n...\n*/</code></pre><p><br></p><pre class=\"language-css\"><code>/*------------------------------------*\\\n    1. GENERAL STYLES\n\\*------------------------------------*/\nhtml, body {\n    height: 100%;\n}\n\nbody {\n    color: #999;\n    background-color: #ebebea;\n    font-family: \"Open Sans\", sans-serif;\n    font-size: 14px;\n    line-height: 24px;\n    font-weight: 400;\n    word-wrap: break-word;\n}\n\nbody.page-light {\n    background-color: #fff;\n}\n\np:last-child { /* RESET MARGIN OF LAST P TAG */\n    margin-bottom: 0;\n}\n\nul:last-child {\n    margin-bottom: 0;\n}\n\ntable:last-child {\n    margin-bottom: 0;\n}</code></pre>"},{"title":"JS Structure","content":"<pre class=\"language-html\"><code>&lt;!-- Scripts --&gt;\n&lt;script src=\"assets/js/jquery.min.js\"&gt;&lt;/script&gt;\n&lt;script src=\"assets/js/jquery-ui.min.js\"&gt;&lt;/script&gt;\n&lt;script src=\"assets/js/bootstrap.bundle.min.js\"&gt;&lt;/script&gt;\n&lt;script src=\"assets/js/perfect-scrollbar.min.js\"&gt;&lt;/script&gt;\n&lt;script src=\"assets/js/jquery.sparkline.min.js\"&gt;&lt;/script&gt;\n&lt;script src=\"assets/js/raphael.min.js\"&gt;&lt;/script&gt;\n&lt;script src=\"assets/js/morris.min.js\"&gt;&lt;/script&gt;\n&lt;script src=\"assets/js/select2.min.js\"&gt;&lt;/script&gt;\n&lt;script src=\"assets/js/jquery-jvectormap.min.js\"&gt;&lt;/script&gt;\n&lt;script src=\"assets/js/jquery-jvectormap-world-mill.min.js\"&gt;&lt;/script&gt;\n&lt;script src=\"assets/js/horizontal-timeline.min.js\"&gt;&lt;/script&gt;\n&lt;script src=\"assets/js/jquery.validate.min.js\"&gt;&lt;/script&gt;\n&lt;script src=\"assets/js/jquery.steps.min.js\"&gt;&lt;/script&gt;\n&lt;script src=\"assets/js/dropzone.min.js\"&gt;&lt;/script&gt;\n&lt;script src=\"assets/js/ion.rangeSlider.min.js\"&gt;&lt;/script&gt;\n&lt;script src=\"assets/js/datatables.min.js\"&gt;&lt;/script&gt;\n&lt;script src=\"assets/js/main.js\"&gt;&lt;/script&gt;\n\n&lt;!-- Page Level Scripts --&gt;\n</code></pre><p><br></p><pre class=\"language-js\"><code>/*\n\nProject     : DAdmin - Responsive Bootstrap HTML Admin Dashboard\nVersion     : 1.1\nAuthor      : ThemeLooks\nAuthor URI  : https://themeforest.net/user/themelooks\n\n*/\n\n(function ($) {\n    \"use strict\";\n    \n    /* ------------------------------------------------------------------------- *\n     * COMMON VARIABLES\n     * ------------------------------------------------------------------------- */\n    var $wn = $(window),\n        $document = $(document),\n        $body = $('body');\n\n    $(function () {\n        /* ------------------------------------------------------------------------- *\n         * BACKGROUND IMAGE\n         * ------------------------------------------------------------------------- */\n        var $bgImg = $('[data-bg-img]');\n\n        $bgImg.css('background-image', function () {\n            return 'url(\"' + $(this).data('bg-img') + '\")';\n        }).addClass('bg--img').removeAttr('data-bg-img');\n\n        /* ------------------------------------------------------------------------- *\n         * TOOLTIP\n         * ------------------------------------------------------------------------- */\n        var $tooltip = $('[data-toggle=\"tooltip\"]');\n\n        if ( $tooltip.length ) {\n            $tooltip.tooltip();\n        }</code></pre>"},{"title":"Browser Support","content":"<p>DAdmin Supports a wide range of browsers.</p><table class=\"table table-bordered text-center\"><tbody><tr><td><p><img src=\"data:image/gif;base64,\" data-filename=\"temp.gif\" style=\"width: 31px; box-shadow: none;\"><b><br></b></p><p><b>Chrome</b></p></td><td><p><img src=\"data:image/gif;base64,\" data-filename=\"temp.gif\" style=\"width: 31px; box-shadow: none;\"><b><br></b></p><p><b>Firefox</b></p></td><td><p><img src=\"data:image/gif;base64,\" data-filename=\"temp.gif\" style=\"width: 28px; box-shadow: none;\"><b><br></b></p><p><b>Edge</b></p></td><td><p><img src=\"data:image/gif;base64,\" data-filename=\"temp.gif\" style=\"width: 28px; box-shadow: none;\"><b><br></b></p><p><b>Safari</b></p></td><td><p><img src=\"data:image/gif;base64,\" data-filename=\"temp.gif\" style=\"width: 30px; box-shadow: none;\"><b><br></b></p><p><b>Opera</b></p></td></tr><tr><td>Supported<br></td><td>Supported<br></td><td>Supported<br></td><td>Supported<br></td><td>Supported<br></td></tr></tbody></table>"}]},{"title":"Components","contents":[{"title":"Buttons","content":"<h4><b>Default Buttons:</b></h4><p>Use class&nbsp;<code>.btn-*</code>&nbsp;for button color variations:</p><p><b>Example:</b></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 1170px;\"><br></p><p><b>Code:</b></p><pre class=\"language-html\"><code>&lt;button class=\"btn <u>btn-default</u>\"&gt;Default&lt;/button&gt;\n&lt;button class=\"btn <u>btn-primary</u>\"&gt;Primary&lt;/button&gt;\n&lt;button class=\"btn <u>btn-info</u>\"&gt;Info&lt;/button&gt;\n&lt;button class=\"btn <u>btn-danger</u>\"&gt;Danger&lt;/button&gt;\n&lt;button class=\"btn <u>btn-success</u>\"&gt;Success&lt;/button&gt;\n&lt;button class=\"btn <u>btn-warning</u>\"&gt;Warning&lt;/button&gt;\n</code></pre><p><br></p><h4><b>Disabled Buttons:</b></h4><p>Use attribute&nbsp;<code>disabled</code>&nbsp;for disabled buttons.</p><p><b>Example:</b></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 1170px;\"><br></p><p><b>Code:</b></p><pre class=\"language-html\"><code>&lt;button class=\"btn btn-default\" <u>disabled</u>&gt;Default&lt;/button&gt;\n&lt;button class=\"btn btn-primary\" <u>disabled</u>&gt;Primary&lt;/button&gt;\n&lt;button class=\"btn btn-info\" <u>disabled</u>&gt;Info&lt;/button&gt;\n&lt;button class=\"btn btn-danger\" <u>disabled</u>&gt;Danger&lt;/button&gt;\n&lt;button class=\"btn btn-success\" <u>disabled</u>&gt;Success&lt;/button&gt;\n&lt;button class=\"btn btn-warning\" <u>disabled</u>&gt;Warning&lt;/button&gt;\n</code></pre><p><br></p><h4><b>Outline Buttons:</b></h4><p>Use class&nbsp;<code>.btn-outline-*</code>&nbsp;for outlined buttons.</p><p><b>Example:</b></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 1170px;\"></p><p><b>Code:</b></p><pre class=\"language-html\"><code>&lt;button class=\"btn <u>btn-outline-secondary</u>\"&gt;Default&lt;/button&gt;\n&lt;button class=\"btn <u>btn-outline-primary</u>\"&gt;Primary&lt;/button&gt;\n&lt;button class=\"btn <u>btn-outline-info</u>\"&gt;Info&lt;/button&gt;\n&lt;button class=\"btn <u>btn-outline-danger</u>\"&gt;Danger&lt;/button&gt;\n&lt;button class=\"btn <u>btn-outline-success</u>\"&gt;Success&lt;/button&gt;\n&lt;button class=\"btn <u>btn-outline-warning</u>\"&gt;Warning&lt;/button&gt;\n</code></pre><p><br></p><h4><b>Button Sizes:</b></h4><p>Use class&nbsp;<code>.btn-lg</code>&nbsp;for large buttons and <code>.btn-sm</code>&nbsp;for smaller buttons.</p><p><b>Example:</b></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 610px;\"><b><br></b></p><p><b>Code:</b></p><pre class=\"language-html\"><code>&lt;button class=\"btn btn-outline-secondary <u>btn-lg</u> mb-3\"&gt;Large Button&lt;/button&gt;\n&lt;button class=\"btn btn-outline-secondary mb-3\"&gt;Default Button&lt;/button&gt;\n&lt;button class=\"btn btn-outline-secondary <u>btn-sm</u> mb-3\"&gt;Small Button&lt;/button&gt;</code></pre><p><br></p><h4><b>Rounded Buttons:</b></h4><p>Use class&nbsp;<code>.btn-rounded</code>&nbsp;for rounded buttons.</p><p><b>Example:</b></p><p><img style=\"width: 1170px;\" src=\"data:image/png;base64,\" data-filename=\"temp.png\"><b><br></b></p><p><b>Code:</b></p><pre class=\"language-html\"><code>&lt;button class=\"btn <u>btn-rounded</u> btn-primary\"&gt;Primary&lt;/button&gt;</code></pre><p><br></p><h4><b>Dropdown Buttons:</b></h4><p>Use class&nbsp;<code>.dropdown-toggle</code>&nbsp;and&nbsp;<code>data-toggle=\"dropdown\"</code>&nbsp;attribute for dropdown buttons.</p><p><b>Example:</b></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 610px;\"></p><p><b>Code:</b></p><pre class=\"language-html\"><code>&lt;button class=\"btn btn-rounded btn-primary <u>dropdown-toggle</u>\" <u>data-toggle=\"dropdown\"</u>&gt;Dropdown&lt;/button&gt;\n\n&lt;div class=\"dropdown-menu\" data-x-placement=\"bottom-start\"&gt;\n    &lt;a href=\"#\" class=\"dropdown-item\"&gt;Menu Item&lt;/a&gt;\n    &lt;a href=\"#\" class=\"dropdown-item\"&gt;Menu Item&lt;/a&gt;\n    &lt;a href=\"#\" class=\"dropdown-item\"&gt;Menu Item&lt;/a&gt;\n&lt;/div&gt;\n</code></pre><p><br></p><h4><b>Button Groups:</b></h4><p>Use a wrapper element and <code>.btn-group</code> class for button groups.</p><p><b>Example:</b></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 286px;\"><br></p><p><b>Code:</b></p><pre class=\"language-html\"><code>&lt;div class=\"<u>btn-group</u>\"&gt;\n    &lt;a href=\"#\" class=\"btn btn-rounded btn-outline-secondary\"&gt;Left&lt;/a&gt;\n    &lt;a href=\"#\" class=\"btn btn-rounded btn-outline-secondary\"&gt;Middle&lt;/a&gt;\n    &lt;a href=\"#\" class=\"btn btn-rounded btn-outline-secondary\"&gt;Right&lt;/a&gt;\n&lt;/div&gt;\n</code></pre><p><br></p><h4><b>Vertical Button Groups:</b></h4><p>Use a wrapper element and <code>.btn-group</code> and <code>.btn-group-vertical</code> class together for vertical button groups.</p><p><b>Example:</b></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 140px;\"><br></p><p><b>Code:</b></p><pre class=\"language-html\"><code>&lt;div class=\"<u>btn-group btn-group-vertical</u>\"&gt;\n    &lt;a href=\"#\" class=\"btn btn-rounded btn-outline-secondary\"&gt;Top&lt;/a&gt;\n    &lt;a href=\"#\" class=\"btn btn-rounded btn-outline-secondary\"&gt;Middle&lt;/a&gt;\n    &lt;a href=\"#\" class=\"btn btn-rounded btn-outline-secondary\"&gt;Bottom&lt;/a&gt;\n&lt;/div&gt;\n</code></pre>"},{"title":"Pagination","content":"<h4><b>Default Pagination:</b></h4><p><b>Example:</b></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 214px;\"><br></p><p><b>Code:</b></p><pre class=\"language-html\"><code>&lt;ul class=\"pagination\"&gt;\n    &lt;li class=\"page-item\"&gt;&lt;a href=\"#\" class=\"page-link\"&gt;1&lt;/a&gt;&lt;/li&gt;\n    &lt;li class=\"page-item\"&gt;&lt;a href=\"#\" class=\"page-link\"&gt;2&lt;/a&gt;&lt;/li&gt;\n    &lt;li class=\"page-item active\"&gt;&lt;a href=\"#\" class=\"page-link\"&gt;3&lt;/a&gt;&lt;/li&gt;\n    &lt;li class=\"page-item\"&gt;&lt;a href=\"#\" class=\"page-link\"&gt;4&lt;/a&gt;&lt;/li&gt;\n    &lt;li class=\"page-item\"&gt;&lt;a href=\"#\" class=\"page-link\"&gt;5&lt;/a&gt;&lt;/li&gt;\n&lt;/ul&gt;</code></pre><p><br></p><h4><b>Sizes:</b></h4><p>Use class <code>.pagination-lg</code>&nbsp;for larger paginations and <code>.pagination-sm</code> for smaller paginations.</p><p><b>Example:</b></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 230px;\"><br></p><p><b>Code:</b></p><pre class=\"language-html\"><code>&lt;!-- Larger Pagination --&gt;\n&lt;ul class=\"pagination <u>pagination-lg</u>\"&gt;\n    &lt;li class=\"page-item\"&gt;...&lt;/li&gt;\n&lt;/ul&gt;\n\n&lt;!-- Regular Pagination (Default) --&gt;\n&lt;ul class=\"pagination\"&gt;\n    &lt;li class=\"page-item\"&gt;...&lt;/li&gt;\n&lt;/ul&gt;\n\n&lt;!-- Smaller Pagination --&gt;\n&lt;ul class=\"pagination <u>pagination-sm</u>\"&gt;\n    &lt;li class=\"page-item\"&gt;...&lt;/li&gt;\n&lt;/ul&gt;\n</code></pre><p><br></p><h4><p><b style=\"color: inherit; font-family: inherit;\">Alignment:</b></p></h4><p>Use class&nbsp;<code>.justify-content-center</code>&nbsp;and <code>.justify-content-end</code> to change the alignment of paginations. Default pagination is left aligned and doesn't need any utility class.</p><p><b>Example:</b></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 1170px;\"></p><p><b>Code:</b></p><pre class=\"language-html\"><code>&lt;!-- Left Aligned Pagination (Default) --&gt;\n&lt;ul class=\"pagination\"&gt;\n    ...\n&lt;/ul&gt;\n\n&lt;!-- Center Aligned Pagination --&gt;\n&lt;ul class=\"pagination <u>justify-content-center</u>\"&gt;\n    ...\n&lt;/ul&gt;\n\n&lt;!-- Right Aligned Pagination --&gt;\n&lt;ul class=\"pagination <u>justify-content-center</u>\"&gt;\n    ...\n&lt;/ul&gt;\n</code></pre>"},{"title":"Progress Bars","content":"<h4><b>Default Progress Bars:</b></h4><p>Use class <code>.progress-bar</code> and <code>.progress</code> wrapper element and utility classes for adding progress bars.</p><p><b>Example:</b></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 410px;\"><b><br></b></p><p><b>Code:</b></p><pre class=\"language-html\"><code>&lt;div class=\"<u>progress</u> h-15px\"&gt;\n    &lt;div class=\"<u>progress-bar</u> w-75\"&gt;&lt;/div&gt;\n&lt;/div&gt;</code></pre><p><b><br></b></p><h4><b>Progress Labels:</b></h4><p>Place text inside <code>.progress-bar</code> element for adding progress labels.</p><p><b>Example:</b></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 411px;\"><b><br></b></p><p><b>Code:</b></p><pre class=\"language-html\"><code>&lt;div class=\"progress h-15px\"&gt;\n   &lt;div class=\"progress-bar bg-green w-75\"&gt;<u>75%</u>&lt;/div&gt;\n&lt;/div&gt;</code></pre><p><br></p><h4><b>Colored Progress Bars:</b></h4><p>Use background utility classes for colored progress bars.</p><p>Example:</p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 415px;\"><br></p><p>Code:</p><pre class=\"language-html\"><code>&lt;div class=\"progress\"&gt;\n    &lt;div class=\"progress-bar <u>bg-info</u> w-75\"&gt;&lt;/div&gt;\n&lt;/div&gt;\n\n&lt;div class=\"progress\"&gt;\n    &lt;div class=\"progress-bar <u>bg-orange</u> w-50\"&gt;&lt;/div&gt;\n&lt;/div&gt;\n\n&lt;div class=\"progress\"&gt;\n    &lt;div class=\"progress-bar <u>bg-green</u> w-25\"&gt;&lt;/div&gt;\n&lt;/div&gt;\n\n&lt;div class=\"progress\"&gt;\n    &lt;div class=\"progress-bar <u>bg-dark</u> w-50\"&gt;&lt;/div&gt;\n&lt;/div&gt;\n\n&lt;div class=\"progress\"&gt;\n    &lt;div class=\"progress-bar <u>bg-red</u> w-75\"&gt;&lt;/div&gt;\n&lt;/div&gt;\n\n&lt;!-- Default Pagination --&gt;\n&lt;div class=\"progress\"&gt;\n    &lt;div class=\"progress-bar w-50\"&gt;&lt;/div&gt;\n&lt;/div&gt;\n</code></pre><p><br></p><h4><b>Animated Striped Progress Bar:</b></h4><p>Use class <code>.progress-bar-striped</code> for striped progress bars.</p><p><b>Example:</b></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 408px;\"><br></p><p><b>Code:</b></p><pre class=\"language-html\"><code>&lt;div class=\"progress h-15px\"&gt;\n    &lt;div class=\"progress-bar <u>progress-bar-striped</u> bg-info w-75\"&gt;&lt;/div&gt;\n&lt;/div&gt;</code></pre><p><br></p><h4><b>Animated Striped Progress Bar:</b></h4><p>Use class <code>.progress-bar-animated</code> for animating striped progress bars.</p><p><b>Example:</b></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 415px;\"><br></p><p><b>Code:</b></p><pre class=\"language-html\"><code>&lt;div class=\"progress h-15px\"&gt;\n    &lt;div class=\"progress-bar <u>progress-bar-striped</u> progress-bar-animated bg-red w-50\"&gt;&lt;/div&gt;\n&lt;/div&gt;</code></pre>"},{"title":"Tabs & Accordions","content":"<h4><b>Tabs:</b></h4><p><b>Example:</b></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 616px;\"><br></p><p><b>Code:</b></p><pre class=\"language-html\"><code>&lt;!-- Tabs Nav Start --&gt;\n&lt;ul class=\"nav nav-tabs\"&gt;\n    &lt;li class=\"nav-item\"&gt;\n        &lt;a href=\"#tab01\" data-toggle=\"tab\" class=\"nav-link active\"&gt;Home&lt;/a&gt;\n    &lt;/li&gt;\n    &lt;li class=\"nav-item\"&gt;\n        &lt;a href=\"#tab02\" data-toggle=\"tab\" class=\"nav-link\"&gt;Details&lt;/a&gt;\n    &lt;/li&gt;\n    &lt;li class=\"nav-item\"&gt;\n        &lt;a href=\"#tab03\" data-toggle=\"tab\" class=\"nav-link\"&gt;More&lt;/a&gt;\n    &lt;/li&gt;\n&lt;/ul&gt;\n&lt;!-- Tabs Nav End --&gt;\n\n&lt;!-- Tab Content Start --&gt;\n&lt;div class=\"tab-content\"&gt;\n    &lt;!-- Tab Pane Start --&gt;\n    &lt;div class=\"tab-pane fade active show\" id=\"tab01\"&gt;...&lt;/div&gt;\n    &lt;!-- Tab Pane End --&gt;\n\n    &lt;!-- Tab Pane Start --&gt;\n    &lt;div class=\"tab-pane fade\" id=\"tab02\"&gt;...&lt;/div&gt;\n    &lt;!-- Tab Pane End --&gt;\n\n    &lt;!-- Tab Pane Start --&gt;\n    &lt;div class=\"tab-pane fade\" id=\"tab03\"&gt;...&lt;/div&gt;\n    &lt;!-- Tab Pane End --&gt;\n&lt;/div&gt;\n&lt;!-- Tab Content End --&gt;\n</code></pre><p><br></p><h4><b>Accordions:</b></h4><p><b>Example:</b></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 608px;\"><b><br></b></p><p><b>Code:</b></p><pre class=\"language-html\"><code>&lt;div id=\"accordion01\"&gt;\n    &lt;!-- Card Start --&gt;\n    &lt;div class=\"card\"&gt;\n        &lt;div class=\"card-header\"&gt;\n            &lt;h5 class=\"h5\"&gt;\n                &lt;button class=\"btn btn-link collapse-icon\" data-toggle=\"collapse\" data-target=\"#collapse01\"&gt;Collapse Group Item #1&lt;/button&gt;\n            &lt;/h5&gt;\n        &lt;/div&gt;\n\n        &lt;div id=\"collapse01\" class=\"collapse show\" data-parent=\"#accordion01\"&gt;\n            &lt;div class=\"card-body\"&gt;...&lt;/div&gt;\n        &lt;/div&gt;\n    &lt;/div&gt;\n    &lt;!-- Card End --&gt;\n\n    &lt;!-- Card Start --&gt;\n    &lt;div class=\"card\"&gt;\n        &lt;div class=\"card-header\"&gt;\n            &lt;h5 class=\"h5\"&gt;\n                &lt;button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#collapse02\"&gt;Collapse Group Item #2&lt;/button&gt;\n            &lt;/h5&gt;\n        &lt;/div&gt;\n\n        &lt;div id=\"collapse02\" class=\"collapse\" data-parent=\"#accordion01\"&gt;\n            &lt;div class=\"card-body\"&gt;...&lt;/div&gt;\n        &lt;/div&gt;\n    &lt;/div&gt;\n    &lt;!-- Card End --&gt;\n\n    &lt;!-- Card Start --&gt;\n    &lt;div class=\"card\"&gt;\n        &lt;div class=\"card-header\"&gt;\n            &lt;h5 class=\"h5\"&gt;\n                &lt;button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#collapse03\"&gt;Collapse Group Item #3&lt;/button&gt;\n            &lt;/h5&gt;\n        &lt;/div&gt;\n\n        &lt;div id=\"collapse03\" class=\"collapse\" data-parent=\"#accordion01\"&gt;\n            &lt;div class=\"card-body\"&gt;...&lt;/div&gt;\n        &lt;/div&gt;\n    &lt;/div&gt;\n    &lt;!-- Card End --&gt;\n\n    &lt;!-- Card Start --&gt;\n    &lt;div class=\"card\"&gt;\n        &lt;div class=\"card-header\"&gt;\n            &lt;h5 class=\"h5\"&gt;\n                &lt;button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#collapse04\"&gt;Collapse Group Item #4&lt;/button&gt;\n            &lt;/h5&gt;\n        &lt;/div&gt;\n\n        &lt;div id=\"collapse04\" class=\"collapse\" data-parent=\"#accordion01\"&gt;\n            &lt;div class=\"card-body\"&gt;...&lt;/div&gt;\n        &lt;/div&gt;\n    &lt;/div&gt;\n    &lt;!-- Card End --&gt;\n&lt;/div&gt;</code></pre>"},{"title":"Modals","content":"<h4><b>Basic Modal:</b></h4><p><b>Example:</b><br></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 740px;\"></p><p><b>Code:</b><br></p><pre class=\"language-html\"><code>&lt;a href=\"#basicModal\" class=\"btn btn-outline-secondary\" data-toggle=\"modal\"&gt;View Demo&lt;/a&gt;\n\n&lt;!-- Basic Modal Start --&gt;\n&lt;div id=\"basicModal\" class=\"modal fade\"&gt;\n    &lt;div class=\"modal-dialog\"&gt;\n        &lt;div class=\"modal-content\"&gt;\n            &lt;div class=\"modal-header\"&gt;\n                &lt;h5 class=\"modal-title\"&gt;Modal Title&lt;/h5&gt;\n\n                &lt;button type=\"button\" class=\"close\" data-dismiss=\"modal\"&gt;&amp;times;&lt;/button&gt;\n            &lt;/div&gt;\n\n            &lt;div class=\"modal-body\"&gt;\n                &lt;p&gt;Modal Body Content&lt;/p&gt;\n            &lt;/div&gt;\n\n            &lt;div class=\"modal-footer\"&gt;\n                &lt;button type=\"button\" class=\"btn btn-default\" data-dismiss=\"modal\"&gt;Close&lt;/button&gt;\n\n                &lt;button type=\"button\" class=\"btn btn-success\"&gt;Save&lt;/button&gt;\n            &lt;/div&gt;\n        &lt;/div&gt;\n    &lt;/div&gt;\n&lt;/div&gt;\n&lt;!-- Basic Modal End --&gt;</code></pre><p><br></p><h4><b>Vertically Centered Modals:</b></h4><p>Use class <code>.modal-dialog-centered</code> for certering modals vertically.</p><p><b>Example:</b></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 614px;\"></p><p><b>Code:</b></p><pre class=\"language-html\"><code>&lt;!-- Vertically Centered Modal Start --&gt;\n&lt;div id=\"vCenteredModal\" class=\"modal fade\"&gt;\n    &lt;div class=\"modal-dialog <u>modal-dialog-centered</u>\"&gt;\n        &lt;div class=\"modal-content\"&gt;...&lt;/div&gt;\n    &lt;/div&gt;\n    ...\n&lt;/div&gt;\n&lt;!-- Vertically Centered Modal End --&gt;\n</code></pre><p><br></p><h4><b>Large Modals:</b></h4><p>Use class <code>.modal-lg</code> for large modals.</p><p><b>Example:</b></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 843px;\"><br></p><p><b>Code:</b></p><pre class=\"language-html\"><code>&lt;!-- Large Modal Start --&gt;\n&lt;div id=\"largeModal\" class=\"modal fade\"&gt;\n    &lt;div class=\"modal-dialog <u>modal-lg</u>\"&gt;\n        &lt;div class=\"modal-content\"&gt;...&lt;/div&gt;\n    &lt;/div&gt;\n&lt;/div&gt;\n&lt;!-- Large Modal End --&gt;</code></pre><p><br></p><h4><b>Small Modals:</b></h4><p>Use class <code>.modal-sm</code> for small modals.</p><p><b>Example:</b></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 351px;\"><br></p><p><b>Code:</b></p><pre class=\"language-html\"><code>&lt;!-- Small Modal Start --&gt;\n&lt;div id=\"smallModal\" class=\"modal fade\"&gt;\n    &lt;div class=\"modal-dialog <u>modal-sm</u>\"&gt;\n        &lt;div class=\"modal-content\"&gt;...&lt;/div&gt;\n    &lt;/div&gt;\n&lt;/div&gt;\n&lt;!-- Small Modal End --&gt;</code></pre>"},{"title":"UI Slider","content":"<h4><b>Single Range Slider:</b></h4><p><b>Example:</b></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 1170px;\"><b><br></b></p><p><b>Code:</b></p><pre class=\"language-html\"><code>&lt;form action=\"#\" class=\"mb-5\"&gt;\n    &lt;input type=\"text\" name=\"example\" value=\"\" data-trigger=\"range-slider\" data-min=\"100\" data-max=\"1000\" data-from=\"200\"&gt;\n&lt;/form&gt;</code></pre><p><b><br></b></p><h4><b>Multiple Range Slider:</b></h4><p><b>Example:</b></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 1170px;\"><b><br></b></p><p><b>Code:</b></p><pre class=\"language-html\"><code>&lt;form action=\"#\" class=\"mb-5\"&gt;\n    &lt;input type=\"text\" name=\"example\" value=\"\" data-trigger=\"range-slider\" data-prefix=\"$\" data-min=\"100\" data-max=\"1000\" data-from=\"400\" data-to=\"600\" data-type=\"double\" data-grid=\"true\" data-grid-num=\"10\"&gt;\n&lt;/form&gt;</code></pre><p><b><br></b></p>"},{"title":"Sweet Alerts","content":"<h4><b>Basic Sweet Alert:</b></h4><p>Add attribute <code>data-sweet-alert=\"basic\"</code> for basic sweet alerts.</p><p><b>Example:</b></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 526px;\"><br></p><p><b>Code:</b></p><pre class=\"language-html\"><code>&lt;a href=\"#\" <u>data-sweet-alert=\"success\"</u>&gt;...&lt;/a&gt;</code></pre>"},{"title":"Form Elements","content":"<p><b>Basic Form:</b></p><p><b>Example:</b></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 613px;\"><br></p><p><b>Code:</b></p><pre class=\"language-html\"><code>&lt;div class=\"form-group\"&gt;\n    &lt;label&gt;\n        &lt;span class=\"label-text\"&gt;Email Address&lt;/span&gt;\n        &lt;input type=\"email\" name=\"email\" placeholder=\"Enter Your Email...\" class=\"form-control\"&gt;\n    &lt;/label&gt;\n&lt;/div&gt;\n\n&lt;div class=\"form-group\"&gt;\n    &lt;label&gt;\n        &lt;span class=\"label-text\"&gt;Password&lt;/span&gt;\n        &lt;input type=\"password\" name=\"password\" placeholder=\"Enter Your Password...\" class=\"form-control\"&gt;\n    &lt;/label&gt;\n&lt;/div&gt;\n\n&lt;div class=\"form-group pt-1 pb-1\"&gt;\n    &lt;label class=\"form-check\"&gt;\n        &lt;input type=\"checkbox\" name=\"checkbox\" value=\"1\" class=\"form-check-input\"&gt;\n        &lt;span class=\"form-check-label\"&gt;Remember Me&lt;/span&gt;\n    &lt;/label&gt;\n&lt;/div&gt;\n\n&lt;input type=\"submit\" value=\"Submit\" class=\"btn btn-sm btn-rounded btn-success\"&gt;\n&lt;button type=\"button\" class=\"btn btn-sm btn-rounded btn-outline-secondary\"&gt;Cancel&lt;/button&gt;</code></pre>"}]},{"title":"Utility Classes","contents":[{"title":"Text Colors","content":"<p><b>Example:</b></p>\n<p style=\"color: #2bb3c0;\">.text-blue</p>\n<p style=\"color: #e16123;\">.text-orange</p>\n<p style=\"color: #009378;\">.text-green</p>\n<p style=\"color: #ff4040;\">.text-red</p>\n<p style=\"color: #999;\">.text-lightergray</p>\n<p><b>Code:</b></p><pre class=\"language-html\"><code>&lt;p class=\"<u>text-blue</u>\"&gt;.text-blue&lt;/p&gt;\n&lt;p class=\"<u>text-orange</u>\"&gt;.text-orange&lt;/p&gt;\n&lt;p class=\"<u>text-green</u>\"&gt;.text-green&lt;/p&gt;\n&lt;p class=\"<u>text-red</u>\"&gt;.text-red&lt;/p&gt;\n&lt;p class=\"<u>text-lightergray</u>\"&gt;.text-lightergray&lt;/p&gt;\n</code></pre>"},{"title":"Background Colors","content":"<p><b>Example:</b></p>\n<p class=\"p-2 d-flex\" style=\"color: #fff; background-color: #2bb3c0;\">.bg-blue <span style=\"margin-left: auto;\">#2bb3c0</span></p>\n<p class=\"p-2 d-flex\" style=\"color: #fff; background-color: #e16123;\">.bg-orange <span style=\"margin-left: auto;\">#e16123</span></p>\n<p class=\"p-2 d-flex\" style=\"color: #fff; background-color: #009378;\">.bg-green <span style=\"margin-left: auto;\">#009378</span></p>\n<p class=\"p-2 d-flex\" style=\"color: #fff; background-color: #ff4040;\">.bg-red <span style=\"margin-left: auto;\">#ff4040</span></p>\n<p class=\"p-2 d-flex\" style=\"color: #fff; background-color: #252525;\">.bg-darker <span style=\"margin-left: auto;\">#252525</span></p>\n<p class=\"p-2 d-flex\" style=\"background-color: #ebebea;\">.bg-whitesmoke <span style=\"margin-left: auto;\">#ebebea</span></p>\n<p><b>Code:</b></p><pre class=\"language-html\"><code>&lt;p class=\"p-2 d-flex text-white <u>bg-blue</u>\"&gt;.bg-blue&lt;/p&gt;\n&lt;p class=\"p-2 d-flex text-white <u>bg-orange</u>\"&gt;.bg-orange&lt;/p&gt;\n&lt;p class=\"p-2 d-flex text-white <u>bg-green</u>\"&gt;.bg-green&lt;/p&gt;\n&lt;p class=\"p-2 d-flex text-white <u>bg-red</u>\"&gt;.bg-red&lt;/p&gt;\n&lt;p class=\"p-2 d-flex text-white <u>bg-darker</u>\"&gt;.bg-darker&lt;/p&gt;\n&lt;p class=\"p-2 d-flex <u>bg-whitesmoke</u>\"&gt;.bg-whitesmoke&lt;/p&gt;</code></pre>"},{"title":"Border Colors","content":"<p><b>Example:</b></p>\n<p class=\"p-2 d-flex\" style=\"border: 1px solid #2bb3c0;\">.bg-blue <span style=\"margin-left: auto;\">#2bb3c0</span></p>\n<p class=\"p-2 d-flex\" style=\"border: 1px solid #009378;\">.bg-green <span style=\"margin-left: auto;\">#009378</span></p>\n<p class=\"p-2 d-flex\" style=\"border: 1px solid #e16123;\">.bg-orange <span style=\"margin-left: auto;\">#e16123</span></p>\n<p class=\"p-2 d-flex\" style=\"border: 1px solid #ff4040;\">.bg-red <span style=\"margin-left: auto;\">#ff4040</span></p>\n<p><b>Code:</b></p><pre class=\"language-html\"><code>&lt;p class=\"p-2 d-flex border <u>border-blue</u>\"&gt;.bg-blue&lt;/p&gt;\n&lt;p class=\"p-2 d-flex border <u>border-green</u>\"&gt;.bg-green&lt;/p&gt;\n&lt;p class=\"p-2 d-flex border <u>border-orange</u>\"&gt;.bg-orange&lt;/p&gt;\n&lt;p class=\"p-2 d-flex border <u>border-red</u>\"&gt;.bg-red&lt;/p&gt;\n</code></pre><p></p>"}]},{"title":"Other","contents":[{"title":"FAQ","content":"<!-- Card Start -->\n<div class=\"card\">\n  <div class=\"card-header\">\n    <h5 class=\"h5\">\n      <button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#faqItem04\" aria-expanded=\"false\">\n        <span>How To Change The Logo?</span>\n      </button>\n    </h5>\n  </div>\n  <div id=\"faqItem04\" class=\"collapse\" style=\"\">\n    <div class=\"card-body\">\n      <p>You can change the logo by either replace it from img folder or you can edit the HTML code:</p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 1170px;\"></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 1170px;\"></p>\n    </div>\n  </div>\n</div>\n<!-- Card End -->\n\n<!-- Card Start -->\n<div class=\"card\">\n  <div class=\"card-header\">\n    <h5 class=\"h5\">\n      <button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#faqItem05\" aria-expanded=\"false\">\n        <span>How To Change Page Color?</span>\n      </button>\n    </h5>\n  </div>\n  <div id=\"faqItem05\" class=\"collapse\" style=\"\">\n    <div class=\"card-body\">\n      <p>Add <code>.page-light</code> class to the body element:</p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 1170px;\"></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 1168px;\"><br></p>\n    </div>\n  </div>\n</div>\n<!-- Card End -->\n\n<!-- Card Start -->\n<div class=\"card\">\n  <div class=\"card-header\">\n    <h5 class=\"h5\">\n      <button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#faqItem06\" aria-expanded=\"false\">\n        <span>How To Change Sidebar Color?</span>\n      </button>\n    </h5>\n  </div>\n  <div id=\"faqItem06\" class=\"collapse\" style=\"\">\n    <div class=\"card-body\">\n      <p>Add <code>.sidebar-light</code> class to the body element:</p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 1170px;\"></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 1170px;\"><br></p>\n    </div>\n  </div>\n</div>\n<!-- Card End -->\n\n<!-- Card Start -->\n<div class=\"card\">\n  <div class=\"card-header\">\n    <h5 class=\"h5\">\n      <button class=\"btn btn-link collapse-icon collapsed\" data-toggle=\"collapse\" data-target=\"#faqItem07\" aria-expanded=\"false\">\n        <span>How To Change Footer Variations?</span>\n      </button>\n    </h5>\n  </div>\n  <div id=\"faqItem07\" class=\"collapse\" style=\"\">\n    <div class=\"card-body\">\n      <p>Footer Light Version:</p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 1170px;\"></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 1170px;\"></p><p>Footer Dark Version:</p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 1170px;\"></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 1170px;\"></p><p>Footer Transparent Version:</p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 1170px;\"></p><p><img src=\"data:image/png;base64,\" data-filename=\"temp.png\" style=\"width: 1170px;\"><br></p>\n    </div>\n  </div>\n</div>\n<!-- Card End -->"},{"title":"Download Images","content":"<p>If you may want, you can download the preview images from <a href=\"http://themelooks.net/demo/dadmin/html/assets/img.zip\">here</a>.</p>"},{"title":"Changelogs","content":"<p><span style=\"font-weight: 700;\">25 July, 2018 - Version 1.1</span></p><pre class=\"language-html\"><code>* Updated: Responsive Issue Fixed</code></pre>"},{"title":"Credits","content":"<h4><b>Photos:</b></h4><ul><li><i>All 'images' used on the demo site is for demonstration purposes only and are not included in the main download file.</i></li><li><i>All images collected from '<a href=\"https://images.google.com\" target=\"_blank\">Google Image Search</a>'</i></li></ul><h4><b>Fonts:</b></h4><ul><li>Google Fonts (<b><a href=\"https://fonts.google.com/?query=Open+Sans&amp;selection.family=Montserrat:400,500|Open+Sans:300,400,600,700\" target=\"_blank\">Open Sans</a></b> and <b><a href=\"https://fonts.google.com/?query=Montserrat&amp;selection.family=Montserrat:400,500|Open+Sans:300,400,600,700\" target=\"_blank\">Montserrat</a></b>)</li></ul><h4><b>Frameworks / Libraries:</b></h4><p></p><ul><li><a href=\"http://jquery.com\" target=\"_blank\">jQuery</a></li><li><a href=\"https://jqueryui.com\" target=\"_blank\">jQuery UI</a></li><li><a href=\"http://getbootstrap.com\" target=\"_blank\">Twitter Bootstrap</a></li></ul><h4><b>Plugins:</b></h4><p></p><ul><li><a href=\"https://datatables.net\" target=\"_blank\">DataTables</a></li><li><a href=\"https://github.com/enyo/dropzone\" target=\"_blank\">Dropzone.js</a></li><li><a href=\"https://github.com/fullcalendar/fullcalendar\" target=\"_blank\">FullCalendar</a></li><li><a href=\"https://github.com/IonDen/ion.rangeSlider\" target=\"_blank\">Ion.RangeSlider</a></li><li><a href=\"https://github.com/gwatts/jquery.sparkline\" target=\"_blank\">jQuery Sparkline</a></li><li><a href=\"https://github.com/rstaib/jquery-steps\" target=\"_blank\">jQuery Steps</a></li><li><a href=\"https://github.com/jquery-validation/jquery-validation\" target=\"_blank\">jQuery Validation</a></li><li><a href=\"https://github.com/bjornd/jvectormap\" target=\"_blank\">jVectorMap</a></li><li><a href=\"https://github.com/moment/moment\" target=\"_blank\">Moment.js</a></li><li><a href=\"https://github.com/morrisjs/morris.js\" target=\"_blank\">Morris.js</a></li><li><a href=\"https://github.com/utatti/perfect-scrollbar\" target=\"_blank\">Perfect Scrollbar</a></li><li><a href=\"https://github.com/PrismJS/prism\" target=\"_blank\">PrismJS</a></li><li><a href=\"https://github.com/DmitryBaranovskiy/raphael\" target=\"_blank\">Raphael</a></li><li><a href=\"https://github.com/select2/select2\" target=\"_blank\">Select2</a></li><li><a href=\"https://github.com/summernote/summernote\" target=\"_blank\">Summernote</a></li><li><a href=\"https://github.com/t4t5/sweetalert\" target=\"_blank\">SweetAlert</a></li><li><a href=\"https://github.com/hilios/jQuery.countdown\" target=\"_blank\">The Final Countdown</a></li></ul><p></p><p></p>"}]}]};
